import axios from "axios";
import React, { Component } from "react";
import { Row, Col } from "react-bootstrap";

export default class Register extends Component {
    handleSubmit = e => {
        e.preventDefault();
        const data = {
            id: this.id,
            name: this.name,
            email: this.email,
            password: this.password,
            mobile: this.mnumber,
            role: this.role
        };
        // console.log(data);
        axios.post('http://userfeignclient-env.eba-husfvfib.us-east-2.elasticbeanstalk.com/signup',data).then(
            res=>{
                console.log(res)
            }
        ).catch(
            err=>{
                console.log(err)
            }
        )

    }

    render() {
        return (
            <Row className="justify-content-md-center">
                <Col xs={5}>
                    <form onSubmit={this.handleSubmit}>
                        <h3>Sing Up</h3>
                        <div className="form-group">
                            <label>ID</label>
                            <input type="text" className="form-control" placeholder="ID"
                                onChange={e => this.id = e.target.value} />
                        </div>
                        <div className="form-group">
                            <label>Name</label>
                            <input type="text" className="form-control" placeholder="Name"
                                onChange={e => this.name = e.target.value} />
                        </div>
                        <div className="form-group">
                            <label>Email</label>
                            <input type="email" className="form-control" placeholder="Email"
                                onChange={e => this.email = e.target.value} />
                        </div>
                        <div className="form-group">
                            <label>Password</label>
                            <input type="password" className="form-control" placeholder="Password"
                                onChange={e => this.password = e.target.value} />
                        </div>
                        <div className="form-group">
                            <label>Mobile</label>
                            <input type="text" className="form-control" placeholder="Mobile Number"
                                onChange={e => this.mnumber = e.target.value} />
                        </div>
                        <div className="form-group">
                            <label>Role</label>
                            <input type="text" className="form-control" placeholder="Role"
                                onChange={e => this.role = e.target.value} />
                        </div>
                        <br></br>
                        <button className="btn btn-primary btn-block">Sign Up</button>
                    </form>
                </Col>

            </Row>

        );
    }
}
